<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="utf-8">
    <title>Gallery Sepak Bola - Web Sepak Bola STMIK Time</title>
    <style>
        body {
            font-family: Arial, Helvetica, sans-serif;
            margin: 0;
            background-color: #fafafa;
            color: #333;
        }
        h1 {
            color: #008000;
            text-align: center;
            margin: 20px 0;
        }
        .gallery-container {
            display: grid;
            grid-template-columns: repeat(auto-fill, minmax(300px, 1fr));
            gap: 20px;
            margin: 20px;
        }
        .gallery-item {
            background-color: #fff;
            border: 1px solid #ddd;
            border-radius: 8px;
            overflow: hidden;
            box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
            text-align: center;
            padding: 10px;
        }
        .gallery-item img {
            width: 100%;
            height: auto;
            border-radius: 8px;
        }
        .gallery-item p {
            font-size: 16px;
            margin-top: 10px;
            font-weight: bold;
            color: #333;
        }
        .description {
            font-size: 18px;
            line-height: 1.6;
            margin: 20px auto;
            max-width: 800px;
        }
        .btn {
            background-color: #008000;
            color: white;
            padding: 10px 20px;
            border: none;
            border-radius: 5px;
            text-decoration: none;
            cursor: pointer;
            display: inline-block;
            text-align: center;
            margin-top: 20px;
        }
        .btn:hover {
            background-color: #ffcc00;
            color: #333;
        }
    </style>
</head>
<body>

<h1>Gallery Sepak Bola STMIK Time</h1>

<!-- Deskripsi Galeri -->
<div class="description">
    <p>Selamat datang di galeri sepak bola STMIK Time! Di sini Anda dapat melihat gambar-gambar terbaik tentang dunia sepak bola, baik itu pemain, lapangan, maupun momen seru lainnya dari pertandingan yang luar biasa.</p>
</div>

<!-- Galeri Gambar -->
<div class="gallery-container">
    <!-- Gallery Item 1 -->
    <div class="gallery-item">
        <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQ7x2Qix-H20Z-k2dpgildrbOKLixmh-1UavA&s" alt="Pesepak Bola di Lapangan">
        <p>Pemain Sepak Bola Beraksi di Lapangan</p>
    </div>
    
    <!-- Gallery Item 2 -->
    <div class="gallery-item">
        <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQvT7khpTIthVgmZmKBDzZQzqy4qPbc_md-lw&s" alt="Tim Sepak Bola Merayakan">
        <p>Tim Sepak Bola Merayakan Kemenangan</p>
    </div>

    <!-- Gallery Item 3 -->
    <div class="gallery-item">
        <img src="data:image/jpeg;base64," alt="Pemain Sepak Bola Melompat">
        <p>Pemain Sepak Bola Melompat Menyambut Bola</p>
    </div>

    <!-- Gallery Item 4 -->
    <div class="gallery-item">
        <img src="data:image/jpeg;base64," alt="Pemain Dribbling Bola">
        <p>Pemain Sepak Bola Dribbling Bola dengan Cepat</p>
    </div>

    <!-- Gallery Item 5 -->
    <div class="gallery-item">
        <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTLr6Rhn3K6-xSRd2-4hVi1AX5xyQo1C6lMIQ&s" alt="Penjaga Gawang Menyelamatkan Bola">
        <p>Penjaga Gawang Menyelamatkan Bola</p>
    </div>

    <!-- Gallery Item 6 -->
    <div class="gallery-item">
        <img src="data:image/jpeg;base64," alt="Suporter Sepak Bola">
